INSERT INTO `tbl_review_data` VALUES (1,2,22,'image test ','',NULL,'2016-11-19'),(2,2,22,'image test 2','',NULL,'2016-11-19'),(3,2,22,'image test','',NULL,'2016-11-19'),(4,2,22,'testing images ','testing images ',NULL,'2016-11-20'),(5,2,23,'Brief Introduction','great school to study',NULL,NULL),(6,2,23,'Admission Introduction','good admission process',NULL,NULL),(7,2,23,'tester1 review1','review1',NULL,'2016-11-20'),(8,2,23,'jhjhkjh','',NULL,'2016-11-20'),(9,2,23,'school has good oppurtunity for playgroung','kljdslkjflksdj',NULL,'2016-11-22'),(10,3,23,'Best Envoronment for school','kdshgfkshdkjfh',NULL,'2016-11-27'),(11,11,23,'Activities','They have facilities for athletics, football, hockey, cricket, basketball, table tennis, badminton, chess, throw ball and chess. They encourage trekking, rock climbing and mountaineering adventure sports outside the school. They have a music academy for vo',NULL,'2016-12-13'),(12,11,23,'Extra','Extra: They have tie-ups for avenues like i-math, BASE, AAT, ASSET, IAIS, V-Sat.\n\nRemark: They also offer non-scholastic subjects like art, music, electric gadgetry, carpentery.\n\nI thought 3rd language starts only from class 5 for CBSE. Am I mistaken? \nHav',NULL,'2016-12-13'),(13,12,23,'Activities ','Activities: Music, dance, aerobics, theatre, vocals etc. These are conducted after school hours from 3rd standard.\n',NULL,'2016-12-13'),(14,12,23,'Academics',' Only from grade 6, semester system starts. For lower classes, monthly reviews are undertaken. For KG, daily evaluation is conducted.\n',NULL,'2016-12-13'),(15,12,23,'remarks',' NPS is known to be more academically oriented. NPS Rajaji Nagar has been granted autonomy by the CBSE board.\nThe admission process is not transparent. It is better schools post details on their website than having to curse the recptionists.\nHaving applied',NULL,'2016-12-13');
