INSERT INTO `tbl_school_main_table` VALUES (1,'Vidyaniketan School','Ms.Lalitha Desikan','# 30, Kempapura, Hebbal, Bangalore - 560 024','Bangalore','India','560 024','13.0475813','77.59676820000004','http://www.vidyaniketanhebbal.org/','1','2','','5',2,'2','1','yes','080-23331531','Vidya Niketan School features 45 spacious, well- ventilated classrooms designed to make learning a pleasure. All classrooms are equipped with an Interactive White Board and Activinspire which plays a dynamic role in classroom learning and caters to the Mul','Vidya Niketan School follows the ICSE Syllabus till Std X and the ISCsyllabus for Std XI and XII.\n\nThe school is divided into 3 Sections \nPrimary school - Std I to IV Middle School - Std V to VII High School - Std VIII to X The ISC section has two streams - Science and Commerce',0,'1',' vidyaniketan@gmail.com','','2'),(2,'Sindhi High School','MAITHREYI SATYADEV','# 33/2A & B Hebbal Kempapura, Bengaluru, Karnataka 560024','Bangalore','India',' 560024','13.050091','77.59863799999994','http://sindhihighschool.edu.in/','1','2','','5',2,'1','1','yes','080-23621393/4','Sindhi High School at Hebbal was inaugurated on June 9, 2003 by the Deputy Prime Minister, Sri L.K.Advani in the presence of the Chief Minister Sri S.M.Krishna and other dignitaries.This initiative of Sindhi Seva Samiti was an extension of their vision of ','REGISTRATION\n\nRegistration forms may be collected from the School office and submit the duly filled to the School office before the end of registration period.\nIncomplete or illegible registration forms will not be processed\nDate for Interaction / written test will be given at the time of registration\nRegistration fee will not be refunded\nRegistration does not confirm admission. It is subject to qualifying in admission test / interaction and also availability of seats.\nhttp://sindhihighschool.edu.in/hebbal/admissions/\n',0,'1','assistacademicsshshebbal@gmail.com','','2'),(3,'Jain Heritage School','Chenraj RoyChand','Anjaneya Temple Street, Kempapura, Hebbal, Bangalore Karnataka, India - 560 024','Bangalore','India','560024','13.048472','77.60159299999998','http://www.jhs.ac.in','2','2','','5',2,'1','1','yes','+91 80 2362 612','Founded by JGI, Jain Heritage School aims for a holistic approach to educate and guide students with curriculum (CBSE and IGCSE) that ensures comprehensive learning experience. Our school is a co-educational, day-boarding school with extended day care center. We set the highest standards for academic achievement, intellectual growth, ethical awareness and behavior, and sportsmanship for our students.\n\nThe School takes leadership seriously and our emphasis on character development is a point of distinction. The school’s vision and mission attest to the commitment and dedication of faculty and staff, whose scholarly pursuits induce a spirit of innovation and enrich the academic experience for students. Over the years the means of achieving our aims have changed, yet its strategies and planning are still deep-rooted to its vision and origin. It has successfully been able to strike a perennial balance between tradition and innovation to continue to provide exceptional opportunities to deserving students. Our unflagging commitment to each student\'s intellectual, moral and physical growth creates a school which is defining excellence in education.\n\nJHS believes in the notion that teachers should play a key role in student’s lives. JHS faculty does what the best faculties do: it supports the highest level of academic activity, and it also enhances the dignity of every individual and encourages students to fulfil their aspirations. In this way, the faculty fulfills the founding vision of JHS and contributes to a comprehensive learning environment.','Grade IV to VIII\n\nStudents promoted to the subsequent class are eligible for admission on submission of Transfer / School Leaving Certificate (TC) duly countersigned by the appropriate authority and the marks sheet of the lower class. TC if not submitted at the time of joining, is to be submitted within 30 days of joining, failing which the student is liable for withdrawal.\n\nGrade IX\n\nStudents who have studied three languages in Grade VIII are admitted to Grade IX upon submission of TC duly countersigned by appropriate authority. Last date for admission to Grade IX is 10th August, the last date for registration with CBSE.\n\nGeneral\nName of the student will be registered on receipt of the application form duly completed, including the medical form. The filled application form together with all relevant documents may be sent at the address mentioned below:',0,'2','info@jhs.ac.in ','','3'),(4,'dummyschool1','dummy','kempapura hebbal','Bangalore','India','560024','12.9440703','77.67222390000006','','3','2','','3',4,'3','1','','34234343','fdsfdsfds','dsfdsfdsfsd',0,'5','dfdsfds@gmail.com','','5'),(5,'New Priyadarshini School ','','5th Cross, Kempapura, Anjaneyaswamy Temple Street, Near-Sindhi College, Hebbal, Bengaluru, Karnataka 560024','Bangalore','India','560024','13.049467','77.60123299999998','','2','2','','3',4,'3','1','yes','080 3243 3993','New Priyadarshini School is located at , Anjaneyaswamy Temple Street Hebbal Kempapura in Bangalore district of Karnataka, India. New Priyadarshini School is a nursery school,play school,.\n\nIt believes in overall development of the students by balancing academics, extra curricular activities, sports in the state of art infrastructure within the campus. The school offers playgrounds for cricket, basketball, volleyball, table tennis, badminton and other sports. The admission process for this School starts every year in the month of May and School starts in July.','No Details ',0,'2','dummy1@gmail.com','','4'),(6,'AECS Magnolia Maaruti Public School','','No. 36/909, Arakere,  Bannerghatta Road,  Bangalore- 560076 ','Bangalore','India','560076','12.8848657','77.5968643',' aecsgroup.in ','1','2','','5',2,'1','1','yes','080-26485622','AECS Magnolia Maaruti Public School, a CBSE affiliated school is the youngest member of Amrith Educational and Cultural Society, Karnataka. The school was established in the year 2007.Constructed on a two-acre sprawling campus, the school is strategically located on Bannerghatta Road, Bangalore.\n\nSalient features of the school are : \nIntegrated program for various Olympiads, KVPY, NTSE and IIT JEE. \nAlso with Fiit-jee from grade 7 to Grade 12. \nIntegrated coaching for All-India Medical Entrance AIMEE and state Medical and Engineering entrance exams. ','Admissions are open for Pre-Kg to grade XII for academic year 2012 – 13. Application forms for can be collected from school office and submitted along with required documents and fees for confirmation. ',0,'5','magnoliams06@yahoo.com','','2'),(7,'BVM (Bala Vidya Mandir) Global ','','Nandi Woods Campus 67/1 & 67/2, Yelenahalli Village,  Begur Hobli, SOS Village Post, Off Bannergatta Road, Bengaluru','Bangalore','India','560 076','12.8565395','77.60688540000001','nandiwoods.bvmglobal.org ','false','false','','3',0,'false','false','yes',' 96320 66018 ','BVM (Bala Vidya Mandir) Global having roots in Chennai is beginning its new school in Bengaluru from 2011. It is located in South Bangalore and is starting with the primary classes. They have a branch in Coimbatore, Tamil Nadu.Some highlights they had mentioned are: \nThey have play-way and activity method of learning and stress towards academics is in higher classes only. \nNo exams till Class 5.Continuous assessment is followed. \nNo uniforms till class 5. \nVedic Heritage is taught as part of curriculum. \nWi-Fi enabled campus.','Applications are available online or can be had from the school(free). Admission to KG is by lots and for higher classes through entrance exam. \nSiblings and teacher\'s children will be given preference in admissions. (Mentioned in the site) ',0,'1','nandiwoods.bvmglobal.org ','','false'),(8,'Greengrove International School','','Greengrove International School No. 39 /5, Sampigehalli, Jakkur Post Arkavathy Layout, 3rd Block Bengaluru - 560064','Bangalore','India','560064','13.0803805','77.62080800000001','greengroveschool.com','2','2','','3',2,'2','1','yes','92437 18999, 92','Activities: Art, Music , Pottery, Swimming, basketball, tennis, badminton, horse riding\n\nRemark: School proposes to bring in IB syllabus shortly and become a center for BASE.\n\nWonder what happened to Gomathy Global School which was advertised by the same group last year? I think the name has been changed.\nFor more details on Gomathy Education Society and the earlier Gomathy Global School','School proposes to bring in IB syllabus shortly and become a center for BASE.',0,'1','greengroveschool.com','','2'),(9,'Gomathy Global School','Mrs.Aruna ','Gomathy Global School No.39/5, 3RD CRS, Opp Arkavathy Lake, Arkavathy Layout, Jakkur Post, Bangalore ','Bangalore','India','560065','13.0811873','77.621035','http://www.gomathyschool.in/','1','false','','4',0,'false','false','no',' 80-66495499,09','The first Gomathy School was started in the year 1993 in Nellore,Andhra Pradesh. The Gomathi Group of Global Institutions started 3 more schools in 2010-2011 sessions in Tirupati, Rajahmundry and Visakhapatnam. They are starting the Bangalore campus for 2011-2012.','Activities: Painting, Pottery, Woodcraft, Brass work, Modern Painting, Music, Dance, Drama, Theatre, Craft work, Ballet, Carpentry,Puppetry, Poetry etc. \nSports and hobbies (Tentative): Basketball, Cricket, TT, Snooker, Volleyball, Badminton, Chess etc., Omithology, Sericulture, Gardening (Bonsai), Ro-botics, Aero-modeling, Photography, Cookery & Bakery Specialists, Soft skill trainers etc.\n',0,'false','ggsblr@gmail.com ','','5'),(10,'EuroSchool from Eurokids','','Survey No.64, Arkavathy Layout, Jakkur,New Airport Road, Bangalore-560064','Bangalore','India','560064','13.1033304','77.62470069999995',' euroschoolindia.com','false','false','','1',4,'1','false','',' 09440057077,90','The most familiar and foremost pre-primary chain of schools in India, Eurokids is starting a new school in Bangalore, Euroschool. Euroschool completes the school education of the child till class 12. The chain already has 13 schools, both ICSE and CBSE in India including one in Bangalore. They aim to provide a balance school between academics and co-curricular activities. They have a dedicated research centre and a central hub for their schools to access content,methodology and curriculum.\nThree schools are slated to open for 2011-2012 in Bangalore/Bengaluru, but only two have been mentioned in their website.','Admissions: Around October-Novemeber. Middle School, i.e.Class 4 onwards Skill Assessment Test will be conducted. Application forms are available at school office. Kids from Eurokids given preference in admissions.\nAge criteria: For 2011-12: Grade 1- Jan 1,2005 till Dec 31,2005 (This schould be good news for late borns)',0,'false','','','false'),(11,'Venkat International Public School','','6th Block, Rajaji Nagar Bangalore -560 010.','Bangalore','India','560 010','12.9821624','77.55299990000003',' http://www.vips.ac.in/','1','2','','5',3,'2','1','yes',' 080 23502805, ','A regular topper in the school board exams is St. Ann\'s High School in Rajaji Nagar. It is no wonder that they opened Venkat International School in 1995 and it is also topping results.  It has a strength of 5000 students at present.\n','Admissions for 2010-2011 have already started.\nAdmissions are based on entrance test and medical fitness. One thing to note is students promoted from UKG from their school itself have to apply for fresh admissions to 1st. They are exempted from admission fees. I don\'t see what is the need of fresh admissions for a prior student.(any idea?)\nAdmissions begin by October/ November. You will have to first register with the school.\n\nEligibility: Monterssori - 2 years and 5 months as on day of school reopening or 1st June. Likewise for LKG 3 years and 5 months.',0,'1','info@vips.ac.in ','','2'),(12,'National Public School','','1036-A, Purandarapura,  V Block, Rajajinagar,  Bangalore - 560 010 ','Bangalore','India',' 560 010 ','12.9846283','77.54949050000005','http://www.npsinr.com/','false','1','','false',0,'1','false','yes','91-080-23350361','The National Education trust started its first National Public School (NPS) in Rajaji Nagar in 1959 followed by NPS, Indira Nagar in 1982 and NPS, Koramangla in 2003. The International School Bangalore (TISB) and National Academy for Learning (NAFL) are sister concerns. NPS, HSR Layout is the newly started branch in 2009.','Admissions: Registration and issue of applications start in October. NPS schools have started issuing forms for 2010-2011. Each branch follows its own dates. You have to contact in person.\nAdmission for Grade 1 to 9 and 11 is based on written test.\nThe admission procedure is totally opaque.',0,'false','npsrnr@dataone.in ','','false');
